      out.write("\t\t\t\t\t\ttw  += o.w1 + this.bdw;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t\tx = x0 - this.bdw;\r\n");
      out.write("\t\t\t\tfor (var i = this.view - 1, o; o = this.diapos[i]; i--) {\r\n");
      out.write("\t\t\t\t\tif (o.loaded) {\r\n");
      out.write("\t\t\t\t\t\to.w1 = (this.ht / o.r) * this.size;\r\n");
      out.write("\t\t\t\t\t\to.x1 = x - o.w1;\r\n");
      out.write("\t\t\t\t\t\tx   -= o.w1 + this.bdw;\r\n");
      out.write("\t\t\t\t\t\ttw  += o.w1 + this.bdw;\r\n");
      out.write("\t\t\t\t\t\tlw  += o.w1 + this.bdw;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t\t/* ---- move scrollbar ---- */\r\n");
      out.write("\t\t\t\tif (!this.scr && tw) {\r\n");
      out.write("\t\t\t\t\tvar r = (this.ws - this.alw - this.arw - this.bw) / tw;\r\n");
      out.write("\t\t\t\t\tthis.bar.style.left = Math.round(this.alw + lw * r) + 'px';\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t\t/* ---- save preview view ---- */\r\n");
      out.write("\t\t\t\tthis.back = this.view;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t},\r\n");
      out.write("\t\t/* ==== mousewheel scrolling ==== */\r\n");
      out.write("\t\tscroll : function (sc) {\r\n");
      out.write("\t\t\tif (sc < 0) {\r\n");
      out.write("\t\t\t\tif (this.view < this.NF - 1) this.calc(1);\r\n");
      out.write("\t\t\t} else {\r\n");
      out.write("\t\t\t\tif (this.view > 0) this.calc(-1);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t},\r\n");
      out.write("\t\t/* ==== resize  ==== */\r\n");
      out.write("\t\tresize : function () {\r\n");
