      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\t/* //////////// ==== Diapo Constructor ==== //////////// */\r\n");
      out.write("\tDiapo = function (parent, N, src, title, text, url, target) {\r\n");
      out.write("\t\tthis.parent        = parent;\r\n");
      out.write("\t\tthis.loaded        = false;\r\n");
      out.write("\t\tthis.title         = title;\r\n");
      out.write("\t\tthis.text          = text;\r\n");
      out.write("\t\tthis.url           = url;\r\n");
      out.write("\t\tthis.target        = target;\r\n");
      out.write("\t\tthis.N             = N;\r\n");
      out.write("\t\tthis.img           = document.createElement('img');\r\n");
      out.write("\t\tthis.img.src       = src;\r\n");
      out.write("\t\tthis.img.parent    = this;\r\n");
      out.write("\t\tthis.img.className = 'diapo';\r\n");
      out.write("\t\tthis.x0            = this.parent.oc.clientWidth;\r\n");
      out.write("\t\tthis.x1            = this.x0;\r\n");
      out.write("\t\tthis.w0            = 0;\r\n");
      out.write("\t\tthis.w1            = 0;\r\n");
      out.write("\t\tthis.z1            = 1;\r\n");
      out.write("\t\tthis.img.parent    = this;\r\n");
      out.write("\t\tthis.img.onclick   = function() { this.parent.click(); }\r\n");
      out.write("\t\tthis.parent.oc.appendChild(this.img);\r\n");
      out.write("\t\t/* ---- display external link ---- */\r\n");
      out.write("\t\tif (url) {\r\n");
      out.write("\t\t\tthis.img.onmouseover = function () { this.className = 'diapo link';\t}\r\n");
      out.write("\t\t\tthis.img.onmouseout  = function () { this.className = 'diapo'; }\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\t/* //////////// ==== Diapo prototype ==== //////////// */\r\n");
      out.write("\tDiapo.prototype = {\r\n");
      out.write("\t\t/* ==== HTML rendering ==== */\r\n");
      out.write("\t\tmove : function (res) {\r\n");
      out.write("\t\t\tif (this.loaded) {\r\n");
      out.write("\t\t\t\tvar sx = this.x1 - this.x0;\r\n");
      out.write("\t\t\t\tvar sw = this.w1 - this.w0;\r\n");
      out.write("\t\t\t\tif (Math.abs(sx) > 2 || Math.abs(sw) > 2 || res) {\r\n");
      out.write("\t\t\t\t\t/* ---- paint only when moving ---- */\r\n");
      out.write("\t\t\t\t\tthis.x0 += sx * .1;\r\n");
      out.write("\t\t\t\t\tthis.w0 += sw * .1;\r\n");
      out.write("\t\t\t\t\tif (this.x0 < this.parent.wh && this.x0 + this.w0 > 0) {\r\n");
      out.write("\t\t\t\t\t\t/* ---- paint only visible images ---- */\r\n");
      out.write("\t\t\t\t\t\tthis.visible = true;\r\n");
      out.write("\t\t\t\t\t\tvar o = this.img.style;\r\n");
      out.write("\t\t\t\t\t\tvar h = this.w0 * this.r;\r\n");
      out.write("\t\t\t\t\t\t/* ---- diapo ---- */\r\n");
      out.write("\t\t\t\t\t\to.left   = Math.round(this.x0) + 'px';\r\n");
      out.write("\t\t\t\t\t\to.bottom = Math.floor(this.parent.ht * .25) + 'px';\r\n");
      out.write("\t\t\t\t\t\to.width  = Math.round(this.w0) + 'px';\r\n");
      out.write("\t\t\t\t\t\to.height = Math.round(h) + 'px';\r\n");
      out.write("\t\t\t\t\t\t/* ---- reflexion ---- */\r\n");
      out.write("\t\t\t\t\t\tif (this.flx) {\r\n");
      out.write("\t\t\t\t\t\t\tvar o = this.flx.style;\r\n");
      out.write("\t\t\t\t\t\t\to.left   = Math.round(this.x0) + 'px';\r\n");
      out.write("\t\t\t\t\t\t\to.top    = Math.ceil(this.parent.ht * .75 + 1) + 'px';\r\n");
      out.write("\t\t\t\t\t\t\to.width  = Math.round(this.w0) + 'px';\r\n");
      out.write("\t\t\t\t\t\t\to.height = Math.round(h) + 'px';\r\n");
      out.write("\t\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t\t} else {\r\n");
      out.write("\t\t\t\t\t\t/* ---- disable invisible images ---- */\r\n");
      out.write("\t\t\t\t\t\tif (this.visible) {\r\n");
      out.write("\t\t\t\t\t\t\tthis.visible = false;\r\n");
      out.write("\t\t\t\t\t\t\tthis.img.style.width = '0px';\r\n");
      out.write("\t\t\t\t\t\t\tif (this.flx) this.flx.style.width = '0px';\r\n");
      out.write("\t\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t} else {\r\n");
      out.write("\t\t\t\t/* ==== image onload ==== */\r\n");
      out.write("\t\t\t\tif (this.img.complete && this.img.width) {\r\n");
      out.write("\t\t\t\t\t/* ---- get size image ---- */\r\n");
      out.write("\t\t\t\t\tthis.iw     = this.img.width;\r\n");
      out.write("\t\t\t\t\tthis.ih     = this.img.height;\r\n");
      out.write("\t\t\t\t\tthis.r      = this.ih / this.iw;\r\n");
