      out.write("\t\t\t\t\tthis.parent.calc();\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t} else {\r\n");
      out.write("\t\t\t\t/* ---- select diapo ---- */\r\n");
      out.write("\t\t\t\tthis.parent.view = this.N;\r\n");
      out.write("\t\t\t\tthis.parent.calc();\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\treturn false;\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\t/* //////////// ==== public methods ==== //////////// */\r\n");
      out.write("\treturn {\r\n");
      out.write("\t\t/* ==== initialize script ==== */\r\n");
      out.write("\t\tcreate : function (div, size, zoom, border) {\r\n");
      out.write("\t\t\t/* ---- instanciate imageFlow ---- */\r\n");
      out.write("\t\t\tvar load = function () {\r\n");
      out.write("\t\t\t\tvar loaded = false;\r\n");
      out.write("\t\t\t\tvar i = instances.length;\r\n");
      out.write("\t\t\t\twhile (i--) if (instances[i].oCont == div) loaded = true;\r\n");
      out.write("\t\t\t\tif (!loaded) {\r\n");
      out.write("\t\t\t\t\t/* ---- push new imageFlow instance ---- */\r\n");
      out.write("\t\t\t\t\tinstances.push(\r\n");
      out.write("\t\t\t\t\t\tnew ImageFlow(div, size, zoom, border)\r\n");
      out.write("\t\t\t\t\t);\r\n");
      out.write("\t\t\t\t\t/* ---- init script (once) ---- */\r\n");
