      out.write("\t\t\t\t\t\t/* ---- window resize event ---- */\r\n");
      out.write("\t\t\t\t\t\taddEvent(window, 'resize', function () {\r\n");
      out.write("\t\t\t\t\t\t\tvar i = instances.length;\r\n");
      out.write("\t\t\t\t\t\t\twhile (i--) instances[i].resize();\r\n");
      out.write("\t\t\t\t\t\t});\r\n");
      out.write("\t\t\t\t\t\t/* ---- stop drag N drop ---- */\r\n");
      out.write("\t\t\t\t\t\taddEvent(document.getElementById(div), 'mouseout', function (e) {\r\n");
      out.write("\t\t\t\t\t\t\tif (!e) e = window.event;\r\n");
      out.write("\t\t\t\t\t\t\tvar tg = e.relatedTarget || e.toElement;\r\n");
      out.write("\t\t\t\t\t\t\tif (tg && tg.tagName == 'HTML') {\r\n");
      out.write("\t\t\t\t\t\t\t\tvar i = instances.length;\r\n");
      out.write("\t\t\t\t\t\t\t\twhile (i--) instances[i].oc.onmousemove = null;\r\n");
      out.write("\t\t\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t\t});\r\n");
      out.write("\t\t\t\t\t\t/* ---- set interval loop ---- */\r\n");
