      out.write("\t\t\t\t\t\t\tvar i = instances.length;\r\n");
      out.write("\t\t\t\t\t\t\twhile (i--) instances[i].run();\r\n");
      out.write("\t\t\t\t\t\t}, 16);\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\t/* ---- window onload event ---- */\r\n");
      out.write("\t\t\taddEvent(window, 'load', function () { load(); });\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
